import React from 'react';
import './Home.css';

const Home: React.FC = () => {
    return (
        <div className="home-container">
            <h2>Bem-vindo ao Helpdesk System</h2>
            <p>Selecione uma opção no menu para começar.</p>
        </div>
    );
};

export default Home;
